import { IProcessoListaFormView, IProcessoListaFormController } from "../../contracts/Cadastro/ProcessoListaFormContract";
import axios from "../../plugins/axios"

import { Storage } from "../../configuration/storage"
import { Header, HeaderIcon, HeaderAction } from "../../models/header";
import { Headers } from "../../models/headers";

export class ProcessoListaFormController implements IProcessoListaFormController {

    _view: IProcessoListaFormView

    constructor(view: IProcessoListaFormView) {
        this._view = view
    }

    async carregarItens() {
        this._view.loading(true)
        let operacoes: any = [];
        let habilidades: any = [];
        let fases: any = [];
        await axios
            .get('Processo/operacoes')
            .then((response: any) => {

                response.data.forEach((element: any) => {

                    if (element.status == 'A') {
                        element.acoes = [
                            new HeaderAction("mdi-cancel", "primary", "Teste", "deleteItem", "200px")
                        ]
                    }

                    if (element.status == 'I') {
                        element.acoes = [
                            new HeaderAction("mdi-cancel", "error", "Teste", "editarItem", "200px")
                        ]
                    }


                });

                operacoes = response.data;
                //this._view.showItens(response.data)
            }).catch((e: any) => {
                this._view.loading(false)
                this._view.showMsg(e)
            })

        await axios
            .get('Processo/habilidades')
            .then((response: any) => {

                response.data.forEach((element: any) => {

                    if (element.status == 'A') {
                        element.acoes = [
                            new HeaderAction("mdi-cancel", "primary", "Teste", "deleteItem", "200px")
                        ]
                    }

                    if (element.status == 'I') {
                        element.acoes = [
                            new HeaderAction("mdi-cancel", "error", "Teste", "editarItem", "200px")
                        ]
                    }


                });
                this._view.limparCampos();
                this._view.loading(false)
                habilidades = response.data;
                //this._view.showItens(operacoes, response.data)
            }).catch((e: any) => {
                this._view.loading(false)
                this._view.showMsg(e)
            })


        await axios
            .get('Processo/fases')
            .then((response: any) => {

                response.data.forEach((element: any) => {

                    if (element.status == 'A') {
                        element.acoes = [
                            new HeaderAction("mdi-cancel", "primary", "Teste", "deleteItem", "200px")
                        ]
                    }

                    if (element.status == 'I') {
                        element.acoes = [
                            new HeaderAction("mdi-cancel", "error", "Teste", "editarItem", "200px")
                        ]
                    }


                });

                fases = response.data;
                this._view.limparCampos();
                this._view.loading(false)
               
            }).catch((e: any) => {
                this._view.loading(false)
                this._view.showMsg(e)
            })

            await axios
            .get('Processo/categorias')
            .then((response: any) => {

                response.data.forEach((element: any) => {

                    if (element.status == 'A') {
                        element.acoes = [
                            new HeaderAction("mdi-cancel", "primary", "Teste", "deleteItem", "200px")
                        ]
                    }

                    if (element.status == 'I') {
                        element.acoes = [
                            new HeaderAction("mdi-cancel", "error", "Teste", "editarItem", "200px")
                        ]
                    }


                });
                this._view.limparCampos();
                this._view.loading(false)
                this._view.showItens(operacoes, habilidades, fases, response.data)
                //this._view.showItens(operacoes, response.data)
            }).catch((e: any) => {
                this._view.loading(false)
                this._view.showMsg(e)
            })


        // await axios
        // .get('Processo/paradas')
        // .then((response: any) => {

        //     response.data.forEach((element: any) => {

        //         if (element.status == 'A') {
        //             element.acoes = [
        //                 new HeaderAction("mdi-cancel", "primary", "Teste", "deleteItem", "200px")
        //             ]
        //         }

        //         if (element.status == 'I') {
        //             element.acoes = [ 
        //                 new HeaderAction("mdi-cancel", "error", "Teste", "editarItem", "200px")
        //             ]
        //         }


        //     });
        //     this._view.limparCampos();
        //     this._view.loading(false)
        //     this._view.showItens(operacoes, habilidades, response.data)
        // }).catch((e: any) => {
        //     this._view.loading(false)
        //     this._view.showMsg(e)
        // })
    }

    salvar(processo: any): void {

        this._view.loading(true);

        axios
            .post("Processo", processo)
            .then((response: any) => {
                this._view.loading(false);
                if (response.data.sucesso) {
                    this._view.showMsg(response.data.message);
                    this.carregarItens();

                } else {
                    this._view.showMsg("Não foi possível salvar os dados do Linha");
                }
            })
            .catch((e: any) => {
                this._view.loading(false);
                this._view.showMsg(e);
            });

    }


    deleteitem(id: number): void {
        this._view.loading(true)

        axios.delete('Processo/' + id).then((response: any) => {
            this._view.loading(false)
            if (response.data.sucesso) {
                // this._view.showMsg("Salvo com sucesso.")
                this._view.showMsg(response.data.message)
                this.carregarItens();
            } else {
                this._view.showMsg(response.data.message)
            }
        }).catch((e: any) => {
            this._view.loading(false)
            this._view.showMsg(e)
        })
    }

    ativaritem(id: number): void {
        this._view.loading(true)

        axios.put('Processo/' + id).then((response: any) => {
            this._view.loading(false)
            if (response.data.sucesso) {
                // this._view.showMsg("Salvo com sucesso.")
                this._view.showMsg(response.data.message)
                this.carregarItens();
            } else {
                this._view.showMsg(response.data.message)
            }
        }).catch((e: any) => {
            this._view.loading(false)
            this._view.showMsg(e)
        })
    }


}
